import { NenchoHeader } from '../components/nenchoHeader';

const Nencho: NextPage = () => {
  const statusNum: { [key: string]: number } = {
    EMPTY: 0,
    FINISHED: 1,
    TBC: 2,
  };

  // FIXME: 実データに入れ替えてください。
